  return (
      <div className="container">



          <Button variant="success">Success</Button>

          <Button variant="primary">Primary</Button>

          <Button variant="danger">Danger</Button>



          <Alert key="1" variant="success">

              This is a success alertâ€”check it out!

          </Alert>

      </div>
  );
}

export default App;
